function Osusume() {
  return (
    <div>
    <h1>Osusume</h1>
      <ul>
        <li><a href="/">Question List</a></li>
        <li><a href="/Questiont">Questions</a></li>
      </ul>
    </div>
  );
}

export default Osusume;
